// components/Sidebar.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import { FaHome, FaCompass, FaFilm, FaTv, FaUser, FaBars, FaSearch } from 'react-icons/fa';

const SidebarContainer = styled.nav`
  width: ${props => props.isOpen ? '200px' : '60px'};
  background-color: #1a1a1a;
  padding: 20px;
  transition: width 0.3s ease;
  position: fixed;
  height: 100vh;
  overflow-y: auto;
`;

const NavItem = styled(Link)`
  display: flex;
  align-items: center;
  color: #fff;
  text-decoration: none;
  padding: 10px 0;
  &:hover {
    color: #ffd700;
  }
`;

const IconWrapper = styled.span`
  margin-right: ${props => props.isOpen ? '10px' : '0'};
`;

const ToggleButton = styled.button`
  background: none;
  border: none;
  color: #fff;
  font-size: 1.5rem;
  cursor: pointer;
  margin-bottom: 20px;
`;

const SubMenu = styled.div`
  display: ${props => props.isOpen ? 'block' : 'none'};
  margin-left: 20px;
`;

const SubMenuItem = styled(Link)`
  display: block;
  color: #fff;
  text-decoration: none;
  padding: 5px 0;
  &:hover {
    color: #ffd700;
  }
`;

function Sidebar() {
  const [isOpen, setIsOpen] = useState(true);
  const [showTVGenres, setShowTVGenres] = useState(false);
  const [showActorCategories, setShowActorCategories] = useState(false);

  const toggleSidebar = () => setIsOpen(!isOpen);

  return (
    <SidebarContainer isOpen={isOpen}>
      <ToggleButton onClick={toggleSidebar}>
        <FaBars />
      </ToggleButton>
      <NavItem to="/"><IconWrapper isOpen={isOpen}><FaHome /></IconWrapper> {isOpen && 'Home'}</NavItem>
      <NavItem to="/discovery"><IconWrapper isOpen={isOpen}><FaCompass /></IconWrapper> {isOpen && 'Discovery'}</NavItem>
      <NavItem to="/movies"><IconWrapper isOpen={isOpen}><FaFilm /></IconWrapper> {isOpen && 'Movies'}</NavItem>
      <NavItem as="div" onMouseEnter={() => setShowTVGenres(true)} onMouseLeave={() => setShowTVGenres(false)}>
        <IconWrapper isOpen={isOpen}><FaTv /></IconWrapper> {isOpen && 'TV Shows'}
        {isOpen && showTVGenres && (
          <SubMenu isOpen={isOpen}>
            <SubMenuItem to="/tv-shows/drama">Drama</SubMenuItem>
            <SubMenuItem to="/tv-shows/comedy">Comedy</SubMenuItem>
            <SubMenuItem to="/tv-shows/scifi">Sci-Fi</SubMenuItem>
          </SubMenu>
        )}
      </NavItem>
      <NavItem as="div" onMouseEnter={() => setShowActorCategories(true)} onMouseLeave={() => setShowActorCategories(false)}>
        <IconWrapper isOpen={isOpen}><FaUser /></IconWrapper> {isOpen && 'Actors'}
        {isOpen && showActorCategories && (
          <SubMenu isOpen={isOpen}>
            <SubMenuItem to="/actors/popular">Popular</SubMenuItem>
            <SubMenuItem to="/actors/upcoming">Upcoming</SubMenuItem>
            <SubMenuItem to="/actors/award-winning">Award-Winning</SubMenuItem>
          </SubMenu>
        )}
      </NavItem>
    </SidebarContainer>
  );
}

export default Sidebar;
